Email an Jörg Thiem
* Wer soll einen Zugang? (Email-Adressen, Sciebo-ID) * Welche Rolle sollen die User erhalten? * Wie soll das Projekt heißen? * Kurzbeschreibung zum Projekt 2-3 Sätze
= Spielregeln =
Um das GitLab nutzen zu können, müssen folgende Nutzungsbedingungen eingehalten werden.
* Das GitLab ist für die Quellcode-Verwaltung, also der Entwicklung von Software ausgelegt (Serverspeicher ist limitiert). Daher sollen nur die Dateien in den Repos abgelegt und verwaltet werden, die für das Software-Projekt unbedingt erforderlich sind. Kleinere Binärdateien können abgelegt werden, wenn Sie für das Projekt zwingend erforderlich sind. Größere Dateien (auch Office-Dokumente) sind in einer Dateiablage (z.B. Sciebo) abzulegen. Auf diese Dateien kann in der Beschreibung der Repos verlinkt werden. * Für allgemeine Tests kann das Testprojekt genutzt werden, welches regelmäßig gelöscht wird.</content> <attachment> <filename>new_user.jpg</filename> <author>XWiki.desch023</author> <date>1557409213000</date> <version>1.1</version> <comment/> <filesize>105193</filesize> </attachment> <attachment> <filename>project_member.png</filename> <author>XWiki.desch023</author> <date>1557411398000</date> <version>1.1</version> <comment/> <filesize>45232</filesize> </attachment> </xwikidoc>@
